import{_ as e}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as p,c as t,e as c}from"./app.c5b3201b.js";const r={},a=c('<p>今天上午看到了联想管家助手推送的驱动更新，本来之前也没注意，今天不知道怎么就想点一下更新一下。结果更新完毕后，就出现了没有wifi标志的情况。</p><p>之后查看设备管理器，里面的网卡启动，显示的是代码56。</p><p>也是搜了很多的方法，这里只说一个解决了我的问题的方法。</p><p>我也不清楚为什么，就是和VMware是有关的。如果代码56，解决方法就是删除VMware，之后去注册表里面找VMware。注册表就是cmd里面输入regedit</p><p>进去后找vmnet之后删除重启就可以了。</p><p>还有一些我看到的，但是没实验过的，实验失败的就不说了。</p><p>就是拔开电源，然后长按开机键15秒。</p><p>还有一个方法我觉得也挺靠谱，当时电脑上没下载。</p><p><img src="https://cdn.jsdelivr.net/gh/xiaou61/pictures/202307250940314.png" alt="image-20230725094040218" loading="lazy"></p><p>用cclean的注册表删除，其实归根结底，就是因为VMware的原因。</p>',10),o=[a];function n(i,s){return p(),t("div",null,o)}const d=e(r,[["render",n],["__file","5.html.vue"]]);export{d as default};
